import styled from 'styled-components'

export const Container = styled.div`
    background-color: #17181f;
    color: #797a81;
    min-height: 100vh;
    font-family: Verdana;
`;

export const Area = styled.div`
    margin: auto;
    max-width: 980px;
    padding:10px;
`;

export const Header = styled.div`
    .nav-list{
        display: flex;
        list-style: none;
    }

    .nav-list li {
        letter-spacing: 3px;
        margin-left: 200px;
        color:#fff;
      }
    


`;
